script: |
  super -f text -I q7790.spq | sort > q7790.out

inputs:
  - name: q7790.spq
    data: |
      SELECT ALL - col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE col1 * - col2 + col1 BETWEEN + - col2 AND - 29 + + 14 + + col0 * - col2 * + 52;
  - name: tab0

outputs:
  - name: q7790.out
    data: |
